  `b_zipcode` varchar(32) NOT NULL DEFAULT \'\',
  `b_phone` varchar(128) NOT NULL DEFAULT \'\',
  `s_firstname` varchar(128) NOT NULL DEFAULT \'\',
  `s_lastname` varchar(128) NOT NULL DEFAULT \'\',
  `s_address` varchar(255) NOT NULL DEFAULT \'\',
