  `s_county` varchar(32) NOT NULL DEFAULT \'\',
  `s_state` varchar(32) NOT NULL DEFAULT \'\',
  `s_country` char(2) NOT NULL DEFAULT \'\',
  `s_zipcode` varchar(32) NOT NULL DEFAULT \'\',
  `s_phone` varchar(128) NOT NULL DEFAULT \'\',
